import React from 'react';
import NextCard from './NextCard';

function Home() {
  return (
    <>
      <div className='container'>
        <h1>Sorry!</h1>
        <div className='wrapper'>
          <NextCard />
          <button onClick={() => NextCard()} className='button'>Next Card</button>
        </div>
      </div>
    </>
  );
}

export default Home;
